import NewsItem from './NewsItem'

export default class  extends Component {
  render() {
    return (
      <div>
        <NewsItem title="International" description="Covid 6th wave started in China"/>
        <NewsItem title="Local News" description="Covid 6th wave started in China"/>
        <NewsItem title="Cricket" description="Covid 6th wave started in China"/>
        <NewsItem title="Politics" description="Covid 6th wave started in China"/>
        <NewsItem title="Health" description="Covid 6th wave started in China"/>
        <NewsItem title="International" description="Covid 6th wave started in China"/>
      </div>
    )
  }
}
